import React from 'react';
import ReactDOM from 'react-dom';
import {add, sum, mul, div} from "./Calc";
ReactDOM.render(
  <>
  <ul>
    <li>{add(40,4)}</li>
    <li>{mul(40,4)}</li>
    <li>{sub(40,4)}</li>
    <li>{add(40,4)}</li>
  </ul>
  </>,document.getElementById("root")
);
